import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AngioIRMCerbrale } from 'src/app/models/AngioIRMCerbrale';
import { echodopplerTransc } from 'src/app/models/echodopplerTransc';
import { EvaluationRendement } from 'src/app/models/EvaluationRendement';
import { AngioirmService } from 'src/app/services/angioirm.service';
import { EchodopplerService } from 'src/app/services/echodoppler.service';
import { RendementService } from 'src/app/services/rendement.service';

@Component({
  selector: 'app-rendement',
  templateUrl: './rendement.component.html',
  styleUrls: ['./rendement.component.css']
})
export class RendementComponent {

  EvaluationRendement: EvaluationRendement = new EvaluationRendement();
  AngioIRMCerbrale: AngioIRMCerbrale = new AngioIRMCerbrale();
  echodopplerTransc: echodopplerTransc = new echodopplerTransc();
  patientId: string | null = null;

  errorMessage: string = '';

  constructor(private RendementService: RendementService, private AngioirmService:AngioirmService, private EchodopplerService:EchodopplerService , private router:Router) {}
  ngOnInit(): void {
    // Retrieve the PatientId from local storage
    this.patientId = localStorage.getItem('patientId');
  
    if (this.patientId && this.patientId !== '0') {
      console.log('Patient ID retrieved from local storage:', this.patientId);
    } else {
      console.error('No valid Patient ID found in local storage.');
    }
  }

  onSubmit() {  
    this.RendementService.addev(this.EvaluationRendement).subscribe(
      response => {
        console.log('Complication added successfully', response);
        this.errorMessage = '';
      },
      (error: HttpErrorResponse) => {
        console.error('Error adding Complication', error);
        this.errorMessage = error.error.title;
        if (error.error.errors) {
          for (const [field, errors] of Object.entries(error.error.errors)) {
            console.error(`Validation error for ${field}:`, errors);
          }
        }
      }
    );
    this.AngioirmService.addang(this.AngioIRMCerbrale).subscribe(
      response => {
        console.log('Complication added successfully', response);
        this.errorMessage = '';
      },
      (error: HttpErrorResponse) => {
        console.error('Error adding Complication', error);
        this.errorMessage = error.error.title;
        if (error.error.errors) {
          for (const [field, errors] of Object.entries(error.error.errors)) {
            console.error(`Validation error for ${field}:`, errors);
          }
        }
      }
    );
    this.EchodopplerService.addech(this.echodopplerTransc).subscribe(
      response => {
        console.log('Complication added successfully', response);
        this.errorMessage = '';
      },
      (error: HttpErrorResponse) => {
        console.error('Error adding Complication', error);
        this.errorMessage = error.error.title;
        if (error.error.errors) {
          for (const [field, errors] of Object.entries(error.error.errors)) {
            console.error(`Validation error for ${field}:`, errors);
          }
        }
      }
    );
    if (this.patientId) {
      this.router.navigate(['admin/autrecomp', this.patientId]).then(() => {
        console.log('Navigated to the next page with patientId:', this.patientId);
      }).catch(err => {
        console.error('Navigation error:', err);
      });
    } else {
      console.error('No patientId found. Navigation aborted.');
    }

    
  }
  
}

<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
  
  .form-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
      background-color: #f0f0f0;
    }

    .form-container h1 {
      text-align: center;
      font-size: 36px;
      font-weight: bold;
      color: #2c3e50;
      margin-bottom: 30px;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      border-bottom: 3px solid #3498db;
      padding-bottom: 10px;
      display: inline-block;
    }

    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }

    .form-container form div {
      margin-bottom: 15px;
    }

    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize;
    }

    .form-container form input,
    .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }

    .form-container form .submit-row {
      text-align: center;
      margin-top: 20px;
    }

    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }

    .form-container form input[type="submit"]:hover {
      background-color: #444;
      color: #fff;
    }

    .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }

    /* Style for CNAM radio buttons */
    .radio-group {
      display: flex;
      align-items: center;
      gap: 15px;
    }

    .radio-group input[type="radio"] {
      margin-right: 5px;
    }

    .radio-group label {
      margin: 0;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()" >
     
      <h1>Ostéonécrose aseptique de la tête fémorale    </h1>
    
    
     

     <!-- Osteonecrose -->
     <div>
        <label>Ostéonécrose asptique de la tête fémorale:</label>
        <div class="radio-group">
          <!-- Oui radio button first -->
          <input type="radio" id="evOui" [(ngModel)]="EvaluationRendement.Osteonecrose" [value]="true" name="Osteonecrose" required>
          <label for="evOui">Oui</label>
          
          <!-- No radio button second -->
          <input type="radio" id="evNon" [(ngModel)]="EvaluationRendement.Osteonecrose" [value]="false" name="Osteonecrose" required>
          <label for="evNon">Non</label>
        </div>
      </div>


      
        <!-- Date apparition -->
        <div *ngIf="EvaluationRendement.Osteonecrose">
            <label for="rendement">Date d'apparition</label>
            <input type="date" id="DateApparition" [(ngModel)]="EvaluationRendement.DateApparition" name="DateApparition" >
          </div>
      

          <!-- Siege -->
          <div *ngIf="EvaluationRendement.Osteonecrose">
            <label for="Siege">Siege</label>
            <input type="text" id="Siege" [(ngModel)]="EvaluationRendement.Siege" name="Siege" >
          </div>
  
           <!-- Stade -->
           <div *ngIf="EvaluationRendement.Osteonecrose">
            <label for="Stade">Stade</label>
            <input type="text" id="Stade" [(ngModel)]="EvaluationRendement.Stade" name="Stade" >
          </div>
          <!-- Symptomatique -->
          <div *ngIf="EvaluationRendement.Osteonecrose">
            <label for="Symptomatique">Symptomatique</label>
            <input type="checkbox" id="Symptomatique" [(ngModel)]="EvaluationRendement.Symptomatique" name="Symptomatique" >
          </div>
            <!-- Radio standard -->
            <div *ngIf="EvaluationRendement.Osteonecrose">

            <label for="RadioStandard">Radio Standard</label>
            <input type="checkbox" id="RadioStandard" [(ngModel)]="EvaluationRendement.RadioStandard" name="RadioStandard" >
          </div>
            <!-- Préciser -->

          <div *ngIf="EvaluationRendement.RadioStandard && EvaluationRendement.Osteonecrose">
            <label for="TxtRadio">Préciser</label>
            <input type="text" id="TxtRadio" [(ngModel)]="EvaluationRendement.TxtRadio" name="TxtRadio" >
          </div>
         
           <!-- Irm articulation -->
           <div *ngIf="EvaluationRendement.Osteonecrose">

            <label for="IrmArticulation">Irm Articulation</label>
            <input type="checkbox" id="IrmArticulation" [(ngModel)]="EvaluationRendement.IrmArticulation" name="IrmArticulation" >
          </div>
            <!-- Préciser -->

          <div *ngIf="EvaluationRendement.IrmArticulation && EvaluationRendement.Osteonecrose">
            <label for="TxtIrm">Préciser</label>
            <input type="text" id="TxtIrm" [(ngModel)]="EvaluationRendement.TxtIrm" name="TxtIrm" >
          </div>


          <!-- Traitement chirugical -->
          <div *ngIf="EvaluationRendement.Osteonecrose">

            <label for="TraitementChirurgical">Traitement Chirurgical</label>
            <input type="checkbox" id="TraitementChirurgical" [(ngModel)]="EvaluationRendement.TraitementChirurgical" name="TraitementChirurgical" >
          </div>

           <!-- Date -->

           <div *ngIf="EvaluationRendement.TraitementChirurgical && EvaluationRendement.Osteonecrose">
            <label for="DateTraitement">Date Traitement</label>
            <input type="date" id="DateTraitement" [(ngModel)]="EvaluationRendement.DateTraitement" name="DateTraitement" >
          </div>
            <!-- TxtTritement -->

          <div *ngIf="EvaluationRendement.TraitementChirurgical && EvaluationRendement.Osteonecrose">
            <label for="TxtTritement">Type</label>
            <input type="text" id="TxtTritement" [(ngModel)]="EvaluationRendement.TxtTritement" name="TxtTritement" >
          </div>
       
          <h1>Angio IRM Cerebrale        </h1>

    

 
  <!-- AngioIrmcerbrale1 -->
  <div>
    <label>Angio Irm cerbrale:</label>
    <div class="radio-group">
      <!-- Oui radio button first -->
      <input type="radio" id="anOui" [(ngModel)]="AngioIRMCerbrale.AngioIrmcerbrale1" [value]="true" name="AngioIrmcerbrale1" required>
      <label for="anOui">Oui</label>
      
      <!-- No radio button second -->
      <input type="radio" id="anNon" [(ngModel)]="AngioIRMCerbrale.AngioIrmcerbrale1" [value]="false" name="AngioIrmcerbrale1" required>
      <label for="anNon">Non</label>
    </div>
  </div>

<!-- Date  IRm-->

    <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1">
    <label for="DateIrm">Date de la Dernière IRM</label>
    <input type="date" id="DateIrm" [(ngModel)]="AngioIRMCerbrale.DateIrm" name="DateIrm" >
  </div>
  <!-- Sans anomalies-->

    <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1">
    <label for="SansAnomalies">Sans anomalies:</label>
    <input type="checkbox" id="SansAnomalies" [(ngModel)]="AngioIRMCerbrale.SansAnomalies" name="SansAnomalies" >
  </div>
  <!--Infractus-->

  <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1">
    <label for="Infarctus">Infractus:</label>
    <input type="checkbox" id="Infarctus" [(ngModel)]="AngioIRMCerbrale.Infarctus" name="Infarctus" >
  </div>
      
  <!--PreciserInfarctus-->
  <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1 && AngioIRMCerbrale.Infarctus">
    <label for="PreciserInfarctus">Préciser le siège:</label>
    <input type="text" id="PreciserInfarctus" [(ngModel)]="AngioIRMCerbrale.PreciserInfarctus" name="PreciserInfarctus" >
  </div>
  <!--Stenose-->

  <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1">
    <label for="Stenose">Stenose:</label>
    <input type="checkbox" id="Stenose" [(ngModel)]="AngioIRMCerbrale.Stenose" name="Stenose" >
  </div>
      
  <!--PreciserStenose-->
  <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1 && AngioIRMCerbrale.Stenose">
    <label for="PreciserStenose">Préciser le siège:</label>
    <input type="text" id="PreciserStenose" [(ngModel)]="AngioIRMCerbrale.PreciserStenose" name="PreciserStenose" >
  </div>
  <!--MoyaMoya-->

  <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1">
    <label for="MoyaMoya">Moya Moya:</label>
    <input type="checkbox" id="MoyaMoya" [(ngModel)]="AngioIRMCerbrale.MoyaMoya" name="MoyaMoya" >
  </div>
<!--Autre-->
  <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1">
    <label for="Autre">Autre:</label>
    <input type="checkbox" id="Autre" [(ngModel)]="AngioIRMCerbrale.Autre" name="Autre" >
  </div>
 <!--PreciserAutre-->
 <div *ngIf=" AngioIRMCerbrale.AngioIrmcerbrale1 && AngioIRMCerbrale.Autre">
    <label for="Text">Préciser Autre:</label>
    <input type="text" id="Text" [(ngModel)]="AngioIRMCerbrale.Text" name="Text" >
  </div>

  <h1>Echodopper Transcrânienne (EDTC)</h1>

    

  
  <!-- Echodoppler transcrânienne (EDTC) -->
  <div>
    <label>Echodoppler transcrânienne (EDTC):</label>
    <div class="radio-group">
      <!-- Oui radio button first -->
      <input type="radio" id="aOui" [(ngModel)]="echodopplerTransc.EchodopplerTransc1" [value]="true" name="EchodopplerTransc1" required>
      <label for="aOui">Oui</label>
      
      <!-- No radio button second -->
      <input type="radio" id="aNon" [(ngModel)]="echodopplerTransc.EchodopplerTransc1" [value]="false" name="EchodopplerTransc1" required>
      <label for="aNon">Non</label>
    </div>
  </div>
  <!--EDTC pathologique (actuelle ou ancienne)-->
  <div *ngIf=" echodopplerTransc.EchodopplerTransc1">
    <label for="Edtc">EDTC pathologique (actuelle ou ancienne):</label>
    <input type="checkbox" id="Edtc" [(ngModel)]="echodopplerTransc.Edtc" name="Edtc" >
  </div>
  <!-- Date  -->

  <div *ngIf=" echodopplerTransc.EchodopplerTransc1">
    <label for="DateEdtc">Date de la Dernière EDTC </label>
    <input type="date" id="DateEdtc" [(ngModel)]="echodopplerTransc.DateEdtc" name="DateEdtc" >
  </div>
 
  <!-- Résultat de la Dernière EDTC -->
  <div *ngIf=" echodopplerTransc.EchodopplerTransc1">
    <label for="ResEdtc">Resultat de la Dernière EDTC:</label>
    <select id="ResEdtc" [(ngModel)]="echodopplerTransc.ResEdtc" name="ResEdtc" >
      <option value="Vitesses normale ">Vitesses normales (<170mm/s)</option>
      <option value="Vitesses modérement accélerées ">Vitesses modérement accélerées (170-200mm/s)</option>
      <option value="Vitesses accélérées ">Vitesses accélérées (>200mm/s)
    </option>

    </select>
  </div>
  <h1>Evaluation cognitive Faite</h1>

  <!-- Evaluation -->
  <div>
    <label>Evaluation:</label>
    <div class="radio-group">
      <!-- Oui radio button first -->
      <input type="radio" id="evOui" [(ngModel)]="EvaluationRendement.Evaluation" [value]="true" name="Evaluation" required>
      <label for="evOui">Oui</label>
      
      <!-- No radio button second -->
      <input type="radio" id="evNon" [(ngModel)]="EvaluationRendement.Evaluation" [value]="false" name="Evaluation" required>
      <label for="evNon">Non</label>
    </div>
  </div>
  <!-- Date  -->

  <div *ngIf=" EvaluationRendement.Evaluation">
    <label for="EvaluationTxt">Preciser</label>
    <input type="text" id="EvaluationTxt" [(ngModel)]="EvaluationRendement.EvaluationTxt" name="EvaluationTxt" >
  </div>

  <h1>Rendement scolaire</h1>
<!-- Rendement scolaire -->
<div>
    <label for="Rendement">Rendement scolaire</label>
    <select id="Rendement" [(ngModel)]="EvaluationRendement.Rendement" name="Rendement" >
      <option value="Bon ">Bon (Moy>15/20)</option>
      <option value="Moyen ">Moyen (Moy 10-15/20)    </option>
      <option value="Faible ">Faible (Moy<10/20)</option>

    </select>
  </div>
      <!-- Submit -->
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>
    </form>
  </div>
</body>
</html>
